@herbivorebotanicals did that with their Super Nova eye cream! 

It is rare that you can actually tell an ingredient is in skincare, but when I say I can smell the turmeric, I mean it! Such a great ingredient for depuffing and evening out skin tone. It is an antioxidant and has anti inflammatory properties! I have super sensitive skin and have no issues or redness from this eye cream! The caffeine is great for additional de-puffing and it wears so well under makeup. 1000/10 for sure!

